- name: butt
  description: Says 'butts' every 10 minutes.
  script:
    (while true; do say butts; sleep 600; done) &

- name: dummy
  description: Says 'I am a dummy' every 5 minutes.
  script:
    (while true; do say "Do you know how to use a computer $(id -un) you dummy"; sleep 300; done) &

- name: pbpoop
  description: Copies 'poop' into the clipboard every 5 seconds.
  script:
    (while true; do echo "poop" | pbcopy; sleep 5; done) &

- name: rickroll
  description: Opens rick roll youtube video every 10 minutes.
  script:
    (while true; do open https://www.youtube.com/watch?v=oHg5SJYRHA0; sleep 600; done) &

